import React, { Component } from 'react'

export default class Album extends Component {
  render() {

    console.log("this.props.caption = " + this.props.src);
    console.log("this.props.location = " + this.props.title);
    console.log("this.props.src = " + this.props.description);
    console.log("--------------------------------");

    const image_path = "../images/" + this.props.src;

    return (<div className="photo-entry-block">
    <a href={image_path}>
        <img className="photo-img" src={image_path} alt={image_path}/>
    </a>
        <h5>{this.props.caption}</h5>
        <h6>{this.props.location}</h6>
    </div>
    )
  }
}
